import React, { Component } from "react";

class Time extends Component {
  constructor() {
    super();
    this.state = {
      time: new Date().toLocaleTimeString()
    };
  }

  componentDidMount() {
    this.setState({
      time: new Date().toLocaleTimeString()
    });
  }
  render() {
    return (
      <div>
        <h1>{this.time}</h1>
      </div>
    );
  }
}

export default Time;
